    false,nt"url": null,nt"notes": "Observations at New York bald eagle nest
    sites one, three and four in Livingston, Genesee, and Seneca Counties respectively,
    continued during the 1989 breeding season.  As in 1988 , the majority of staff time
    spent occurred at territory four (Montezuma National Wildlife Refuge). This was
    due to the unusual situation of three adult eagles tending this nest it was felt
    that more detailed documentation of this site would be desirable. This report is
    a summary of information gathered from all three sites.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
